import React,{useState,useEffect} from "react";



const Rows =()=>{
    useEffect(()=>{
        fetch("/selectTr",{
            method:"GET",
            
        }).then(
            res=>res.json()
        ).then(data=>{
            console.log(data)
            rows = data.end.map((item)=>{
               return <tr>
                    <th>{item.trade_id}</th>
                    <th client>{item.client}</th>
                    <th instrument>{item.instrument}</th>
                    <th quantity>{item.quantity}</th>
                    <th direction>{item.direction}</th>
                 </tr> 
            })
            setData(data)
        })
    },[])
}
export default Rows
